import React, { useState, useEffect } from "react";
import MovieInformation from "../../Dialogs/MovieInformation"
import {
  Card,
  CardContent,
  Grid,
  Typography,
  IconButton,
  Tooltip,
  Chip,
} from "@material-ui/core";

export default function Start(props) {
  return (
    <Card>
      <CardContent>
        <span style={{ fontWeight: 550 }}> {props.movie.title} </span>
      </CardContent>


      <MovieInformation
        movie={props.movie}
      ></MovieInformation>
    </Card>
  );
}
